import {
  Table,
  Row,
  Col,
  Container,
  Form,
  Modal,
  Button,
} from "react-bootstrap";
import { useState, useContext } from "react";
import { DataContext } from "../../Data/DataContext";
import "./Profile.css";
import { InputGroup, FormControl } from "react-bootstrap";
import $ from "jquery";
import Header from "../../Components/Header/Header";

function Covid() {
  const [covidModal, setCovidModal] = useState(false);
  const [mapdModal, setMapModal] = useState(false);

  // Thus function to update user user
  const addUser = () => {
    var name = $("#user_name").val(),
      phone = $("#user_phone").val(),
      email = $("#user_email").val(),
      address = $("#user_address").val(),
      map = $("#user_map").val(),
      extra = $("#user_extra").val();
    $.ajax({
      url: "http://gentle.extra-laboratory.com/api/add_user.php",
      type: "post",
      data: {
        name: name,
        phone: phone,
        email: email,
        address: address,
        map: map,
        extra: extra,
      },
      beforeSend: function () {
        $("#loader").show();
      },
      success: function (data) {
        $("#loader").hide();
        alert(data.message);
        setCovidModal(false);
        $.ajax({
          url: "http://gentle.extra-laboratory.com/api/get_covid.php",
          success: function (data) {
            setCovid(data);
          },
          error: function (error) {
            console.log(error);
          },
        });
      },
      error: function (error) {
        $("#loader").hide();
        console.log(error);
      },
    });
  };

  return (
    <div>
      <Header title="PCR Covid-19 test" />
      <br />
      <br />
      <br />
      <br />
      <br />
      <Container>
        <Row style={{ overflow: "auto", height: "90vh", width: "100%" }}>
          <Col md={12} xs={12}></Col>
        </Row>
      </Container>
      <Modal
        show={userModal}
        onHide={() => setUserModal(false)}
        size="lg"
        aria-labelledby="contained-modal-title-vcenter"
        centered
      >
        <Modal.Header closeButton>
          <Modal.Title id="contained-modal-title-vcenter">
            Manageing Users
          </Modal.Title>
        </Modal.Header>
        <Modal.Body>
          <InputGroup className="mb-3">
            <InputGroup.Text
              id="inputGroup-sizing-default"
              style={{ width: "150px" }}
            >
              Sign Nurse:
            </InputGroup.Text>
            <Form.Select id="disabledSelect">
              <option>Select nurse to work on this PCR</option>

              <option>Select nurse to work on this pcr</option>
            </Form.Select>
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text
              id="inputGroup-sizing-default"
              style={{ width: "150px" }}
            >
              Full Name
            </InputGroup.Text>
            <FormControl
              id="edit_name"
              defaultValue={useredit.name}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text
              id="inputGroup-sizing-default"
              style={{ width: "150px" }}
            >
              Phone
            </InputGroup.Text>
            <FormControl
              id="edit_phone"
              defaultValue={useredit.phone}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text
              id="inputGroup-sizing-default"
              style={{ width: "150px" }}
            >
              Email
            </InputGroup.Text>
            <FormControl
              id="edit_email"
              defaultValue={useredit.email}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text
              id="inputGroup-sizing-default"
              style={{ width: "150px" }}
            >
              Address
            </InputGroup.Text>
            <FormControl
              id="edit_password"
              defaultValue={useredit.address}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text
              id="inputGroup-sizing-default"
              style={{ width: "150px" }}
            >
              Loaction
            </InputGroup.Text>
            <FormControl
              id="edit_city"
              defaultValue={useredit.map}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
          <InputGroup className="mb-3">
            <InputGroup.Text
              id="inputGroup-sizing-default"
              style={{ width: "150px" }}
            >
              Extra info
            </InputGroup.Text>
            <FormControl
              id="edit_app"
              defaultValue={useredit.app}
              aria-label="Default"
              aria-describedby="inputGroup-sizing-default"
            />
          </InputGroup>
        </Modal.Body>
        <Modal.Footer>
          <Button /* onClick={() => editRowDone()} */>Make edit</Button>
          <Button /* onClick={() => setUserModal(false)} */>Close</Button>
        </Modal.Footer>
      </Modal>
    </div>
  );
}

export default Covid;
